LEAH + LIZ One of the moments I remember from my time with Leah and Liz was the amount of respect I gained for these two women in listening to their story. Leah and Liz are members of many diverse communities and were so open and honest about what life has been like for them and the challenges they face in aspiring for equality. Thank you Leah and Liz for sharing and for leading by example. If we took the time to listen to one another, we could all live more harmoniously. I also want to thank the team from @lululemon for hosting this life changing project. 
